import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

// importing Components
import VehicleFilters from "../components/VehicleFilters.js";
import VehiclesCardrousel from "../sections/VehiclesCardrousel.js";
import VehicleSearchBar from "../components/VehicleSearchBar.js";
import { VehicleSearchResult } from "../components/VehicleSearchResult.js";

export const Vehicles = () => {
  return (
    <main className="">
      <VehicleSearchBar />
      <VehicleSearchResult />

      <div className="bg-dark p-2" style={{height: '25px'}}>
      
      </div>
      <Row className="justify-content-center bg-dark">
       
      <VehicleFilters/>
          
          <Col>  
          <Container className="d-flex justify-content-center">
          <VehiclesCardrousel />
          </Container>
          </Col>
        
      </Row>
    
    </main>
  );
};

export default Vehicles;
